import SideNavbar from '../Components/SideNavbar';

export default function Exams() {
  return (
    <div class='text-center'>
      <div class='row'>
        <SideNavbar />

        {/* ini buat dashboard */}
        <div class='col-10'>
          <h2>Exams</h2>
          <p>Selamat datang di dashboard Anda!</p>
        </div>
      </div>
    </div>
  );
}
